【絶好調🔥】
.
台風が心配です🌬めっちゃ強いって事だけはニュース見てて分かりました😓
特に私の様な車好きは気になって仕方ないと思います😨
愛車にキズやもしもを考えるだけで…😱
まずは身の安全が最優先です‼️
.
今日も❓かき氷投稿🍧
.
松阪にあるアンデルセンコンデトライ下村店に来ました🚗
目当ては…かき氷🍧
お恥ずかしい話知らなかったぁ〜😓
結構三重、岐阜のかき氷🍧はチェック済みで行ったこと有る無しに関わらず情報は持ってるのですが…申し訳ないです💕
.
ある方に教えて頂きました☺️ありがとうございました🙇🏻‍♂️
.
頼んだのはイチジクミルク‼️
因みに外のテラス席❓で頂きます😀
交差点の角にお店があるので私の様に1人で食べてるとジロジロ見られて少し恥ずかしいわ〜🙈
きっといい宣伝になったのでは🤗
.
イチジクミルクBerryBerryGood😋
とっても見た目もかわいい💕
イチジクのジャム❓コンフィチュール❓コンポート❓分からんけどめっちゃかき氷の中にまでゴロッゴロッ入っていて良かった👍🏻
氷にかかってる練乳との相性も良くバランス型です💕
.
イチジクの香り、甘みが出てるのでさっぱり美味しく食べれました‼️
.
そして2日後…
また来ました😓かき氷が8月いっぱいまでなので😁
今日はブルーベリーミルクを頂きました🎶
.
ビジュアル最高ですね✨
この綺麗な紫色が爽やかです🍃
中にはブルーベリージャムが沢山入っています👍🏻
ジャムなんだけどしっかりブルーベリーが存在感があってゴロッゴロッしてました😆
.
フレッシュなブルーベリーも上にトッピングされています👌🏻
とっても美味しかったです😋
特に暑いこの時期にぴったりです💕
.
仕事終わりのかき氷は最高でした🍧
こちらのお店、夜7:00頃まで営業されてるのですがかき氷もその時間までやってるそう😳
そんな時間までやってるんやぁ〜😁
.
来年も期待して待ってます🔥
.
仕事が変則的になり、体調を崩さないか心配です😰
意外とストレス溜まってそうなので休日は自分の好きな事して楽しみたいです✨
.
きっと良いことがあるさ〜🎶
って思って頑張ってます💦
